import{_ as t,c as a,o as s,aj as r}from"./chunks/framework.DRmbE9yB.js";const g=JSON.parse('{"title":"Fetch Google Sheet Data","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/field-types/google-service-sheet/fetch-google-sheet-data.md","filePath":"documentation/field-types/google-service-sheet/fetch-google-sheet-data.md","lastUpdated":1768407692000}'),o={name:"documentation/field-types/google-service-sheet/fetch-google-sheet-data.md"};function n(i,e,l,d,h,c){return s(),a("div",null,[...e[0]||(e[0]=[r(`<h1 id="fetch-google-sheet-data" tabindex="-1">Fetch Google Sheet Data <a class="header-anchor" href="#fetch-google-sheet-data" aria-label="Permalink to “Fetch Google Sheet Data”">​</a></h1><p>Retrieve data from Google Sheets to use in your automation workflows.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to “Overview”">​</a></h2><p>The Fetch Google Sheet Data field type allows you to interact with Google Sheets, enabling you to fetch data from spreadsheets and use it in your form automation processes. This integration provides direct access to your Google Sheets data with support for caching, retry mechanisms, and flexible data formatting options.</p><h2 id="configuration-options" tabindex="-1">Configuration Options <a class="header-anchor" href="#configuration-options" aria-label="Permalink to “Configuration Options”">​</a></h2><table tabindex="0"><thead><tr><th>Option</th><th>Type</th><th>Description</th><th>Required</th></tr></thead><tbody><tr><td><a href="#google-service-account">Google Service Account</a></td><td>Dropdown</td><td>Select logged-in Google account</td><td><strong>Yes</strong></td></tr><tr><td><a href="#spreadsheet-id">Spreadsheet ID</a></td><td>Input</td><td>Unique identifier of the Google Sheet</td><td><strong>Yes</strong></td></tr><tr><td><a href="#sheet-name">Sheet Name</a></td><td>Input</td><td>Name of the specific sheet tab</td><td><strong>Yes</strong></td></tr><tr><td><a href="#output-range">Output Range</a></td><td>Input</td><td>Cell range to fetch data from</td><td><strong>Yes</strong></td></tr><tr><td><a href="#value-render-option">Value Render Option</a></td><td>Dropdown</td><td>How values should be rendered</td><td>No</td></tr><tr><td><a href="#date-time-render-option">Date Time Render Option</a></td><td>Dropdown</td><td>How dates and times should be rendered</td><td>No</td></tr><tr><td><a href="#enable-caching">Enable Caching</a></td><td>Switch</td><td>Cache data in browser for faster access</td><td>No</td></tr><tr><td><a href="#cache-duration">Cache Duration</a></td><td>Input</td><td>Duration (seconds) cached data remains valid</td><td>No</td></tr><tr><td><a href="#enable-retry">Enable Retry</a></td><td>Switch</td><td>Retry on failure</td><td>No</td></tr><tr><td><a href="#maximum-retries">Maximum Retries</a></td><td>Input</td><td>Maximum number of retry attempts</td><td>No</td></tr></tbody></table><hr><h2 id="option-details" tabindex="-1">Option Details <a class="header-anchor" href="#option-details" aria-label="Permalink to “Option Details”">​</a></h2><h3 id="google-service-account" tabindex="-1">Google Service Account <a class="header-anchor" href="#google-service-account" aria-label="Permalink to “Google Service Account”">​</a></h3><p>Select the Google account you want to use for accessing Google Sheets.</p><p><strong>Type:</strong> Dropdown</p><p><strong>Description:</strong> Choose from your logged-in Google accounts. Make sure the selected account has access to the spreadsheet you want to read.</p><p><strong>Example:</strong></p><ul><li><code>user@gmail.com</code></li><li><code>work@company.com</code></li></ul><hr><h3 id="spreadsheet-id" tabindex="-1">Spreadsheet ID <a class="header-anchor" href="#spreadsheet-id" aria-label="Permalink to “Spreadsheet ID”">​</a></h3><p>The unique identifier of your Google Spreadsheet.</p><p><strong>Type:</strong> Input</p><p><strong>Description:</strong> You can find the Spreadsheet ID in the URL of your Google Sheet.</p><p><strong>How to Find:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>https://docs.google.com/spreadsheets/d/SPREADSHEET_ID/edit</span></span></code></pre></div><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>1BxiMVs0XRA5nFMdKvBdBZjgmUUqptlbs74OgvE2upms</span></span></code></pre></div><hr><h3 id="sheet-name" tabindex="-1">Sheet Name <a class="header-anchor" href="#sheet-name" aria-label="Permalink to “Sheet Name”">​</a></h3><p>The name of the specific sheet tab within your spreadsheet.</p><p><strong>Type:</strong> Input</p><p><strong>Description:</strong> Specify which sheet tab to fetch data from. This is the name visible at the bottom of your Google Sheet.</p><div class="tip custom-block"><p class="custom-block-title">Set Range in Default Value</p><p>You can set the range in the <strong>field default value</strong> of this field.</p><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Sheet1!A1:D10</span></span>
<span class="line"><span>MyData!B2:F100</span></span></code></pre></div></div><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Sheet1</span></span>
<span class="line"><span>Data</span></span>
<span class="line"><span>Sales Report</span></span></code></pre></div><hr><h3 id="output-range" tabindex="-1">Output Range <a class="header-anchor" href="#output-range" aria-label="Permalink to “Output Range”">​</a></h3><p>Specify the cell range to fetch data from.</p><p><strong>Type:</strong> Input</p><p><strong>Description:</strong> Define which cells to retrieve using A1 notation.</p><p><strong>Format:</strong></p><ul><li>Single cell: <code>A1</code></li><li>Range: <code>A1:D10</code></li><li>Entire column: <code>A:A</code></li><li>Entire row: <code>1:1</code></li><li>Multiple ranges: <code>A1:B2,D4:E5</code></li></ul><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>A1:D10</span></span>
<span class="line"><span>B2:F100</span></span>
<span class="line"><span>A:Z</span></span></code></pre></div><hr><h3 id="value-render-option" tabindex="-1">Value Render Option <a class="header-anchor" href="#value-render-option" aria-label="Permalink to “Value Render Option”">​</a></h3><p>Determines how values should be rendered in the output.</p><p><strong>Type:</strong> Dropdown</p><p><strong>Options:</strong></p><table tabindex="0"><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><strong>Formatted Value</strong></td><td>Values will be calculated and formatted as displayed in the UI</td></tr><tr><td><strong>Unformatted Value</strong></td><td>Values will be calculated but not formatted</td></tr><tr><td><strong>Formula</strong></td><td>Values will not be calculated; formulas will be returned as-is</td></tr></tbody></table><p><strong>Example:</strong></p><ul><li><strong>Formatted Value</strong>: <code>$1,000.00</code></li><li><strong>Unformatted Value</strong>: <code>1000</code></li><li><strong>Formula</strong>: <code>=SUM(A1:A10)</code></li></ul><hr><h3 id="date-time-render-option" tabindex="-1">Date Time Render Option <a class="header-anchor" href="#date-time-render-option" aria-label="Permalink to “Date Time Render Option”">​</a></h3><p>Determines how dates and times should be rendered.</p><p><strong>Type:</strong> Dropdown</p><p><strong>Options:</strong></p><table tabindex="0"><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><strong>Date Time</strong></td><td>Dates and times are rendered as formatted strings</td></tr><tr><td><strong>Serial Number</strong></td><td>Dates and times are rendered as serial numbers</td></tr></tbody></table><p><strong>Example:</strong></p><ul><li><strong>Date Time</strong>: <code>2024-01-15 10:30:00</code></li><li><strong>Serial Number</strong>: <code>45307.4375</code></li></ul><hr><h3 id="enable-caching" tabindex="-1">Enable Caching <a class="header-anchor" href="#enable-caching" aria-label="Permalink to “Enable Caching”">​</a></h3><p>Cache fetched data in the browser for faster subsequent access.</p><p><strong>Type:</strong> Switch</p><p><strong>Description:</strong> When enabled, the data will be stored in browser cache, reducing API calls and improving performance.</p><p><strong>Options:</strong></p><ul><li><strong>ON</strong> - Enable caching</li><li><strong>OFF</strong> - Disable caching (fetch fresh data every time)</li></ul><p><strong>Benefits:</strong></p><ul><li>Faster data retrieval</li><li>Reduced API quota usage</li><li>Better performance for frequently accessed data</li></ul><hr><h3 id="cache-duration" tabindex="-1">Cache Duration <a class="header-anchor" href="#cache-duration" aria-label="Permalink to “Cache Duration”">​</a></h3><p>Duration (in seconds) that cached data remains valid.</p><p><strong>Type:</strong> Input</p><p><strong>Description:</strong> Specify how long the cached data should be considered valid before fetching fresh data.</p><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>300    (5 minutes)</span></span>
<span class="line"><span>1800   (30 minutes)</span></span>
<span class="line"><span>3600   (1 hour)</span></span>
<span class="line"><span>86400  (24 hours)</span></span></code></pre></div><p><strong>Note:</strong> This option only works when <a href="#enable-caching">Enable Caching</a> is turned ON.</p><hr><h3 id="enable-retry" tabindex="-1">Enable Retry <a class="header-anchor" href="#enable-retry" aria-label="Permalink to “Enable Retry”">​</a></h3><p>Automatically retry the request if it fails.</p><p><strong>Type:</strong> Switch</p><p><strong>Description:</strong> When enabled, the system will automatically retry fetching data if an error occurs.</p><p><strong>Options:</strong></p><ul><li><strong>ON</strong> - Enable retry on failure</li><li><strong>OFF</strong> - Don&#39;t retry on failure</li></ul><p><strong>Use Cases:</strong></p><ul><li>Network connectivity issues</li><li>Temporary API errors</li><li>Rate limiting scenarios</li></ul><hr><h3 id="maximum-retries" tabindex="-1">Maximum Retries <a class="header-anchor" href="#maximum-retries" aria-label="Permalink to “Maximum Retries”">​</a></h3><p>Maximum number of retry attempts if the request fails.</p><p><strong>Type:</strong> Input</p><p><strong>Description:</strong> Specify how many times the system should retry before giving up.</p><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>3    (Retry up to 3 times)</span></span>
<span class="line"><span>5    (Retry up to 5 times)</span></span>
<span class="line"><span>10   (Retry up to 10 times)</span></span></code></pre></div><p><strong>Note:</strong> This option only works when <a href="#enable-retry">Enable Retry</a> is turned ON.</p><hr><h2 id="use-cases" tabindex="-1">Use Cases <a class="header-anchor" href="#use-cases" aria-label="Permalink to “Use Cases”">​</a></h2><ul><li><strong>Import data from Google Sheets for form filling</strong> - Use spreadsheet data to populate form fields</li><li><strong>Sync spreadsheet data with web forms</strong> - Keep forms synchronized with Google Sheets</li><li><strong>Use Google Sheets as a data source for automation</strong> - Centralize data management in Google Sheets</li><li><strong>Retrieve configuration or reference data from sheets</strong> - Store settings and reference data in spreadsheets</li></ul><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to “Best Practices”">​</a></h2><h3 id="✅-do-s" tabindex="-1">✅ Do&#39;s <a class="header-anchor" href="#✅-do-s" aria-label="Permalink to “✅ Do&#39;s”">​</a></h3><ul><li><strong>Use caching for static data</strong> - Enable caching for data that doesn&#39;t change frequently</li><li><strong>Set appropriate cache duration</strong> - Balance between freshness and performance</li><li><strong>Enable retry for reliability</strong> - Use retry mechanism for critical data fetching</li><li><strong>Use specific ranges</strong> - Fetch only the data you need to improve performance</li><li><strong>Verify account permissions</strong> - Ensure the selected account has access to the spreadsheet</li></ul><h3 id="❌-don-ts" tabindex="-1">❌ Don&#39;ts <a class="header-anchor" href="#❌-don-ts" aria-label="Permalink to “❌ Don&#39;ts”">​</a></h3><ul><li><strong>Don&#39;t cache frequently changing data</strong> - Disable caching for real-time data</li><li><strong>Don&#39;t set excessive retry attempts</strong> - Too many retries can slow down automation</li><li><strong>Don&#39;t fetch entire sheets unnecessarily</strong> - Use specific ranges to optimize performance</li><li><strong>Don&#39;t share Spreadsheet IDs publicly</strong> - Keep your spreadsheet information secure</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to “Troubleshooting”">​</a></h2><h3 id="permission-denied-error" tabindex="-1">Permission Denied Error <a class="header-anchor" href="#permission-denied-error" aria-label="Permalink to “Permission Denied Error”">​</a></h3><p><strong>Solution:</strong> Verify that the selected Google account has access to the spreadsheet.</p><h3 id="invalid-spreadsheet-id" tabindex="-1">Invalid Spreadsheet ID <a class="header-anchor" href="#invalid-spreadsheet-id" aria-label="Permalink to “Invalid Spreadsheet ID”">​</a></h3><p><strong>Solution:</strong> Double-check the Spreadsheet ID from the Google Sheets URL.</p><h3 id="sheet-not-found" tabindex="-1">Sheet Not Found <a class="header-anchor" href="#sheet-not-found" aria-label="Permalink to “Sheet Not Found”">​</a></h3><p><strong>Solution:</strong> Ensure the sheet name exactly matches the tab name in your spreadsheet (case-sensitive).</p><h3 id="empty-data-returned" tabindex="-1">Empty Data Returned <a class="header-anchor" href="#empty-data-returned" aria-label="Permalink to “Empty Data Returned”">​</a></h3><p><strong>Solution:</strong> Verify the output range contains data and the range notation is correct.</p><h3 id="api-quota-exceeded" tabindex="-1">API Quota Exceeded <a class="header-anchor" href="#api-quota-exceeded" aria-label="Permalink to “API Quota Exceeded”">​</a></h3><p><strong>Solution:</strong> Enable caching to reduce API calls or wait for quota reset.</p><h2 id="related-documentation" tabindex="-1">Related Documentation <a class="header-anchor" href="#related-documentation" aria-label="Permalink to “Related Documentation”">​</a></h2><ul><li><a href="/documentation/field-types/google-service-sheet.html">Google Service - Sheet</a></li><li><a href="/documentation/form-fields/field-types.html">Field Types</a></li><li><a href="/documentation/variable.html">Variables</a></li><li><a href="https://developers.google.com/sheets/api" target="_blank" rel="noreferrer">Google Sheets API Documentation</a></li></ul>`,111)])])}const u=t(o,[["render",n]]);export{g as __pageData,u as default};
